  type: 'void' | 'string' | 'number' | 'object' | 'array';
  name?: string;
  title?: any;
  // \u5305\u88C5\u5668\u7EC4\u4EF6
  ['x-decorator']?: string;
  // \u5305\u88C5\u5668\u7EC4\u4EF6\u5C5E\u6027
