  ['x-component-props']?: any;
  // \u5C55\u793A\u72B6\u6001\uFF0C\u9ED8\u8BA4\u4E3A 'visible'
  ['x-display']?: 'none' | 'hidden' | 'visible';
  // \u7EC4\u4EF6\u7684\u5B50\u8282\u70B9\uFF0C\u7B80\u5355\u4F7F\u7528
