  // \u8BBE\u8BA1\u5668\u76F8\u5173

  // \u521D\u59CB\u5316\u5668\uFF0C\u51B3\u5B9A\u5F53\u524D schema \u76F8\u90BB\u4F4D\u7F6E\u53EF\u4EE5\u63D2\u5165\u4EC0\u4E48
  ['x-initializer']?: string;
  ['x-initializer-props']?: any;

  // \u533A\u5757\u8BBE\u7F6E\uFF0C\u51B3\u5B9A\u5F53\u524D schema \u53EF\u4EE5\u914D\u7F6E\u54EA\u4E9B\u53C2\u6570
  ['x-settings']?: string;
