`,paraId:17,tocIndex:11},{value:"When ",paraId:18,tocIndex:11},{value:"store",paraId:18,tocIndex:11},{value:" is omitted, it will use ",paraId:18,tocIndex:11},{value:"defaultStore",paraId:18,tocIndex:11},{value:". In this case, the caching method will change along with the system's default caching method.",paraId:18,tocIndex:11},{value:"When no custom configuration is provided, it returns the default cache space created by global configuration, shared by the current cache method. It is recommended to include a prefix to avoid key conflicts.",paraId:19,tocIndex:11},{value:`// Use default cache method with global configurations
